import React from 'react';
import PoultryLogo from '../Asset/PoultryLogo.jpg'
import Cart from '../Asset/Cart.png'
import './Navbar.css';

function Navbar(){
    return(
        <div className="navbar">
            <div className="navbar_logo">
                <img className='logo' src={PoultryLogo} alt="" />
                <p className="logo_name">Commerce</p>

            </div>
            <div className="navbar_menu">
                <li className="catagory_menu">Meat</li>
                <li className="catagory_menu">Eggs</li>
                <li className="catagory_menu">Equipment</li>
                <li className="catagory_menu">products</li>
            </div>

            <div className="login_cart">
                <button className="login">Login</button>
                <img src={Cart} alt="Cart"/>
            
            </div>
        </div>
    );
}
export default Navbar;
